import { Col, Row } from 'react-bootstrap';
import Wrapper from '../../Common/Wrapper';
import List from './list';
import Create from './create';

function Fruits(){
    return (
        <Wrapper>
            <h1>Fruits</h1>

            <Row>
                <Col>
                    <Create />
                </Col>

                <Col>
                    <List />
                </Col>
            </Row>
        </Wrapper>
    )
}

export default Fruits;
